import React, { useState, useEffect } from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Home from './components/Home';
import LogIn from './components/LogIn';

const App = () => {
	const [result, setResult] = useState([]);
	const [courses, setCourses] = useState([]);
	useEffect(() => { getAllCourses() }, []);
  
	const getAllCourses = () => {
	  axios.get('http://localhost:5000/students/courses')
		.then((res) => {
		  setCourses(res.data);
		})
		.catch((err) => {
		  console.log('ERR: ', err);
		})
	};
  
	return (
		<Router>
			<Home setResult />
			<LogIn/>
			{/* <Route exact path='/'><Result result={result} /></Route> */}
			{/* <Route path='/result'><Result result={result} /></Route> */}
			{/* <Route path="/" render={(props) => <Home {...props} {...info} />} /> */}
			<Route exact path='/result'><Result result={result} /></Route>

		</Router>
	);
};

export default App;
